// src/components/WorkoutPlanner/WorkoutPlanner.js

import React from 'react';

const WorkoutPlanner = () => {
  return (
    <div>
      <iframe
        src="http://localhost:8000/workout_planner"
        title="Workout Planner"
        width="100%"
        height="800px"
        style={{ border: 'none' }}
      ></iframe>
    </div>
  );
};

export default WorkoutPlanner;
